INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24015, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 4, 0.0, 1, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24016, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 1, 4.0, 2, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24017, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 4, 0.0, 3, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 4, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24018, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 2, 5.2, 4, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24019, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 6, 4.2, 5, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 5, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24020, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 2, 0.0, 6, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24021, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 6, 6.4, 7, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24022, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 2, 0.0, 8, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24023, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 3, 10.08, 9, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 6, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24024, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 2, 5.0, 10, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", 24025, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 2, 0.0, 11, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 2, 110501);
